import React, { useState } from "react";
import './style.css';
import Logo from "../../assets/logo.png";
import ImageButton from '../../assets/moon.png'
import imagemButtonblack from '../../assets/sun.png'


export default function Topo(){
    
const[mudarCor,setMudarcor] = useState()
const alterarcor = () => {
    setMudarcor ()
}
    return(
        <header className="black-topo">
            

       <img className="LOGO" src={ Logo } />

       <div>
        <button className="botao-bleck" onClick={alterarcor}><img  className="icone" src={ imagemButtonblack } alt="imagemdobuton"/></button>
       </div>

        </header>

    )
}
